import React, { Component } from 'react';
import Spotify from './Components/spotifyplaylist';
import SpotifyLogin from './Components/spotifylogin';
import AppleLogin from './Components/applelogin';
import ApplePlaylist from './Components/appleplaylist';
import CreateApple from './Components/createApple';
import { connect } from 'react-redux'




class App extends Component {
  componentDidMount(){
    let userID = Math.floor(Math.random()*100000);
    console.log(userID)
    //this.props.adduserID(userID);
  }




  render(){
  return (
    <div className="App">
      <script src="https://js-cdn.music.apple.com/musickit/v1/musickit.js"></script>

      <SpotifyLogin />
      <AppleLogin />
      <ApplePlaylist />
      <CreateApple />
      <Spotify />




    </div>
  );
  }
}

/*const mapDispatchToProps = (dispatch) => {
    return{
        adduserID: (id) => {dispatch ({type: 'ADD_USERID', payload: userID})}
    }
}*/
export default connect()(App);
